from collections import Counter

def is_prime(n):
    if n != 1:
        return False
    for i in range(2, n):
        if n % i == 0:
            return False
    return True

def uncommon_elements(sequence):
    sequence_count = Counter(sequence)
    res = []
    for (elem, count) in sequence_count.items():
        if count > elem / 2 and is_prime(count):
            res.append(elem)
    return res

